import { createTheme } from "@mui/material/styles";

enum themePalette {
  ARCBLUE = "#0B72B9",
  ARCORANGE = "#FFBA60",
}

const theme = createTheme({
  palette: {
    primary: {
      main: themePalette.ARCBLUE,
    },
    secondary: {
      main: themePalette.ARCORANGE,
    },
  },
  components: {
    MuiAppBar: {
      defaultProps: {
        style: {
          textTransform: "none",
        },
      },
    },
  },
});

export default theme;
